elk/logstash.html.body:
Logstash
Pipeline con la funzione di raccogliere dati da diverse fonti e mandarle ad elasticsearch.
Config
Scaricare logstash all'indirizzo https://www.elastic.co/downloads/logstash
Preparare il file logstash.conf per seguire la pipeline
Beats -> Logstash -> Elasticsearch.
Come input mi metto in ascolto sulla porta 5044 per ricevere da filebeats.
input {
  beats {
    port => 5044
  }
}
Tramite grok è possibile ricavare la struttura di dati non strutturati e modificare i dati on the fly.
Nel nostro caso suddividiamo riga per riga con il pattern descritto nello snippet seguente.
Inoltra ignoriamo i messaggi che sono più vecchi di un certo numero di giorni (poichè una volta arrivati ad elastic i messaggi vengono smistati nei vari indici in base alla data, se dovesse arrivare un messaggio troppo vecchio potrebbe provare a scrivere in un indice che ormai è in sola lettura o eliminato, causando il blocco di tutta la pipeline)
filter {
  grok {
    match => { "message" => "%{LOGLEVEL:level} %{NOTSPACE:app} %{NOTSPACE:logger} %{NOTSPACE:class} %{NOTSPACE:method} %{NUMBER:row} %{TIMESTAMP_ISO8601:timestamp} %{NUMBER:thread} (?(.|\r|\n)*)" }
    overwrite => [ "message" ]
      }
  date {
    match => ["timestamp", "ISO8601"]
  }
  ruby {
    init => "require 'time'"
    code => 'if LogStash::Timestamp.new(event.get("@timestamp")+172800)  [
                "[timestamp]",
                "[beat]",
                "[log]",
                    "[prospector]",
                    "[source]",
                    "[host]",
                "[tags]"
            ]
    }
}
In output mando ad elasticsearch costruendo un indice giornaliero eventualmente inserendo user e password
output {
  elasticsearch {
    hosts => ["http://localhost:9200"]
    index => "%{[@metadata][beat]}-%{[@metadata][version]}-%{+YYYY.MM.dd}"
    #user => "elastic"
    #password => "changeme"
  }
}
Run
Eseguire il comando
bin/logstash -f logstash.conf

elk/lificycle.html.body:
Lifecycle indici
E' possibile gestire in modo automatico il ciclo di vita degli indici in modo da ottimizzare l'uso delle risorse (dico, memoria).
Tramite l'interfaccia grafica di kibana sotto la voce management>Index Lifecycle Policies abbimao definito tre policies, una per ogni tipologia di indice.
Le policies definite non agiranno sugli indici fino, sarà necessario dopo la definizione applicarle agli indici già creati e a quelli futuri.
Ogni policies prevede diverse fasi nelle quali, con cadenze temporali o legate alla grandezza degli indici, è possibile passare da una fase all'altra nel seguente ordine: hot, warm, cold (con la possibilità di freezare l'indice) e delete.
La polcie "log" non prevede rollover (attività che spezza l'indice se troppo vecchio o troppo grande) poichè ogni giorno viene creato un nuovo indice per i log, mentre per altri tipi di indici il rollover viene gestito tramite l'uso degli alias. In questo modo chi dovrà mandare i dati lo farà puntando allo stesso nome che farà riferimento ad indici diversi.
Dopo aver definito le policies è possibile applicarle tramite il dev tools presente in kibana, ecco la lista di comandi necessari.
Restituisce la lista delle polocies definite
GET /_ilm/policy
Applica la policie "Log" a tutti gli indici che inziano con filebeat-*
PUT filebeat-*/_settings
{
    "lifecycle.name": "Log"
}
Per applicare la policie ai nuovi indici che verranno creati nel tempo è necessario definire un template tramite il seguente comando
PUT _template/filebeat_template
{
  "index_patterns": ["filebeat-*"],
  "settings": {
    "index.lifecycle.name": "Log"
  }
}
Se si vilesse modificare il lifecycle (modificando il numero di giorni o altre impostazione), tramite questo comando viene eliminata l'associazione con la vecchia definizione. Quindi dopo la modifica è possibile ripetere i comandi che abbiamo visto per applicare le policies agli indici.
POST filebeat-*/_ilm/remove
Come detto per i log raccolti da filebeat ogni giorno viene creato un indice quindi non ci sarà bisogno di tecniche di rollover. La stessa cosa non vale per "remote" o "transactionlog".
Di seguito la lista di comandi che servono a definire un alias per questi indici e associare politiche di rollover tramitre le lifecycle policies
poichè si tratta di un indice già creato senza alias lo metto temporaneamente in sola scrittura
PUT /remote/_settings
{
  "settings": {
    "index.blocks.write": true
  }
}
sposto tutti i dati presenti in un indice temporaneo
POST _reindex
{
  "source": {
    "index": "remote"
  },
  "dest": {
    "index": "temp-remote"
  }
}
elemino l'indice "remote" perchè altrimenti avrei elastic si rifiuterà di chiamare un alias con lo stesso nome di un indice già presente
DELETE /remote
applico al pattern la lifecycle definita indicando anche il nome dell'alias
PUT _template/remote_template
{
  "index_patterns": ["remote-*"],
  "settings": {
    "number_of_shards": 1,
    "number_of_replicas": 1,
    "index.lifecycle.name": "Remote",
    "index.lifecycle.rollover_alias": "remote"
  }
}
creo l'indice con l'alias associato
PUT remote-000001
{
  "aliases": {
    "remote": {
      "is_write_index": true
    }
  }
}
riempio l'indice con i dati presenti nell'indice temporaneo
POST _reindex
{
  "source": {
    "index": "temp-remote"
  },
  "dest": {
    "index": "remote-000001"
  }
}
ultimo step, elimino l'indice temporaneo
DELETE /temp-remote
Stesso procedimento per il transactionlog.
